const ImmigrationtoSouthafrica  = () => {
  return (
    
      <div className="southafricaimmigrationcomponents">
        {" "}
       <a href=""><img className='southafricaimmigrationcomponentsimg' src={Southafricaimmigration} width="320px" height="274px" ></img></a> 
